import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import Adopt from "./Adopt";
import Shop from "./Shop";
import Gallery from './Gallery';
import ProductPage from './ProductPage';
import Board from './Board';
import Login from './Login';

import "./App.css";
import "./Carousel.css";

// Carousel for homepage
function Carousel() {
  const navigate = useNavigate();
  const images = [
    {
      src: "https://placeimg.com/640/480/animals",
      alt: "Adopt a pet",
      description: "Find loving pets ready for adoption.",
      button: {
        label: "Adopt Now",
        onClick: () => navigate("/adopt"),
      },
    },
    {
      src: "https://placeimg.com/640/480/people",
      alt: "Avail Boarding",
      description: "Let us take care of your pet while you are away.",
      button: {
        label: "Avail Now",
        onClick: () => navigate("/board"),
      },
    },
    {
      src: "https://placeimg.com/640/480/nature",
      alt: "Support shelters",
      description: "Support animal shelters through our shop.",
      button: null,
    },
    {
      src: "https://placeimg.com/640/480/tech",
      alt: "Community Care",
      description: "Join our community to help animals.",
      button: null,
    },
  ];

  const [currentIndex, setCurrentIndex] = useState(0);

  const goPrev = () => {
    setCurrentIndex((prev) => (prev === 0 ? images.length - 1 : prev - 1));
  };

  const goNext = () => {
    setCurrentIndex((prev) => (prev === images.length - 1 ? 0 : prev + 1));
  };

  const current = images[currentIndex];

  return (
    <div className="carousel-wrapper">
      <button className="arrow-btn left" onClick={goPrev}>
        <img src="/arrow-left.png" alt="Previous" />
      </button>
      <div className="carousel-item">
        <img src={current.src} alt={current.alt} className="carousel-img" />
        <p className="carousel-desc">{current.description}</p>
        {current.button && (
          <button
            className="btn main-carousel"
            onClick={current.button.onClick}
            style={{ marginTop: "1rem" }}
          >
            {current.button.label}
          </button>
        )}
      </div>
      <button className="arrow-btn right" onClick={goNext}>
        <img src="/arrow-right.png" alt="Next" />
      </button>
    </div>
  );
}

function Home() {
  return (
    <div className="app">
      <section className="hero">
        <h2>Find Your New Best Friend</h2>
        <p>
          Whether youâ€™re looking to adopt a furry companion or want to support animals through mindful shopping,
          Pawmise is here for you.
        </p>
        <button className="btn" onClick={() => window.scrollTo({top: 400, behavior: "smooth"})}>
          Get Started
        </button>
      </section>
      <Carousel />
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/shop" element={<Gallery />} />
        <Route path="/product/:id" element={<ProductPage />} />
        <Route path="/" element={<Home />} />
        <Route path="/adopt" element={<Adopt />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/login" element={<Login />} />
        <Route path="/board" element={<Board />} />
      </Routes>
    </Router>
  );
}
